local gAtr_MI = "";

-----------------------------------------

function Atr_GetVendorPrice (itemID, vpstr)

	if (itemID == nil) then
		return 0;
	end

	if (vpstr == nil) then
		vpstr = gAtr_VP2;
	end

	local price = 0;

	if (itemID > 43900) then
		if (itemID == 43961) then return 25000000; end;
		if (itemID == 44086) then return 25000000; end;
		if (itemID == 44234) then return 50000000; end;
		if (itemID == 44235) then return 50000000; end;
	end


	local x = ((itemID-1) * 4) + 1;
	
	if (x + 3 <= string.len (vpstr)) then

		local s = string.sub (vpstr, x, x+3);

		price = ZC_dec64 (s);
	end

	return price;
end

-----------------------------------------

function Atr_GetBonding (itemID, vpstr)

	if (itemID == nil) then
		return 0;
	end

	-- temp patch for feasts
	if (itemID == 43015 or itemID == 34753 or itemID == 43480 or itemID == 43478) then
		return 0;
	end


	if (vpstr == nil) then
		vpstr = gAtr_MI;
	end

	local bonding = 0;		-- doesn't bind

	local x = ((itemID-1) * 2) + 2;
	
	if (x <= string.len (vpstr)) then

		local s = string.sub (vpstr, x, x);

		bonding = ZC_dec64 (s);
	end

	return bonding;
end

-----------------------------------------

function Atr_DEReqLevel (itemID, vpstr)

	if (itemID == nil) then
		return 0;
	end

	if (vpstr == nil) then
		vpstr = gAtr_MI;
	end

	local reqlevel = 0;	

	local x = ((itemID-1) * 2) + 1;
	
	if (x <= string.len (vpstr)) then

		local s = string.sub (vpstr, x, x);

		local val = ZC_dec64 (s);
		if (val == 1) then
			reqlevel = 1;
		else
			reqlevel = val * 25;
		end
	end

	return reqlevel;
end


